import React from "react";

export default function User(props) {
  console.log(props);
  const { user } = props;
  return (
    <div key={user._id}>
      <Link to={`/user/${user._id}`}>{user.name}</Link>
      <h2>{user.name}</h2>
      <p>{user.email}</p>
    </div>
  );
}
